import React, {Component} from 'react';
// Utluzando statics(estados)
class App extends Component{
     constructor(props){ //por parametro ele o construtor recebe props
        super(props);
        this.state = {
            nome: 'Juan',
            contador: 0
        };
     }

    render(){
        return(
            <div>
                <h1>Contador</h1>
                {this.state.nome}
            </div>
        );
    }
}

export default App;
